  console.log(pages)
  return (
    <div className="pageContainer" style={{ display: "flex",justifyContent:"center" }}>
      {pages.map((el, index) => (
        <div style={{ margin: "20px" }}>
          <button>""</button>
          <PageCell num={index} />
        </div>
      ))}
    </div>
  );
};
